import React, { Component } from "react";

import './scss/components/_wallet.scss';


class Wallet extends Component {
    render() {
     
      return (
          <div className="wallet_wrapper">
          <div className="transaction_info">
          <table  >
  <thead>
    <tr>
      <td>&nbsp;</td>
<td>&nbsp;</td>
    </tr>
  </thead>
<tbody>
<tr>
<td>&nbsp;</td>
<td>&nbsp;</td>
</tr>
<tr>
<td>&nbsp;</td>
<td>&nbsp;</td>
</tr>
</tbody>
</table>
          </div>
           
          </div>
      )
    }
    };


    
export default Wallet;
